// components/About.js
import React from 'react';
import './src/app.css';

const About = () => {
  return (
    <section id="about" className="py-5 bg-light">
      <div className="container">
        <h2 className="mb-4">About Us</h2>
        <p>
          We are a dynamic team of developers building high-quality web applications.
          Our mission is to deliver scalable, user-friendly solutions using modern technologies.
        </p>
      </div>
    </section>
  );
};

export default About;
